%D0%9A%D0%B0%D1%80%D0%BB_VII_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b VII (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u041a\u0430\u0440\u043b VII<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b \u041f\u0440\u0430\u0433\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0441\u0430\u043d\u043a\u0446\u0438\u044e, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u043b\u0441\u044f \u043f\u0440\u0438\u043e\u0440\u0438\u0442\u0435\u0442 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438 \u043d\u0430\u0434 \u0432\u043b\u0430\u0441\u0442\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0430\u043f\u0441\u0442\u0432\u043e\">\u043f\u0430\u043f\u044b \u0440\u0438\u043c\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1445_%D0%B3%D0%BE%D0%B4\" title=\"1445 \u0433\u043e\u0434\">1445<\/a>&#160;\u2014 \u0432 \u0431\u0438\u0442\u0432\u0435 \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B7%D0%B4%D0%B0%D0%BB%D1%8C\" title=\"\u0421\u0443\u0437\u0434\u0430\u043b\u044c\">\u0421\u0443\u0437\u0434\u0430\u043b\u044f<\/a> \u0432\u043e\u0439\u0441\u043a\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%82%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D1%86%D0%B0%D1%80%D0%B5%D0%B2%D0%B8%D1%87%D0%B8\" title=\"\u0422\u0430\u0442\u0430\u0440\u0441\u043a\u0438\u0435 \u0446\u0430\u0440\u0435\u0432\u0438\u0447\u0438\">\u0442\u0430\u0442\u0430\u0440\u0441\u043a\u0438\u0445 \u0446\u0430\u0440\u0435\u0432\u0438\u0447\u0435\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%85%D0%BC%D1%83%D0%B4_(%D0%BA%D0%B0%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%85%D0%B0%D0%BD)\" title=\"\u041c\u0430\u0445\u043c\u0443\u0434 (\u043a\u0430\u0437\u0430\u043d\u0441\u043a\u0438\u0439 \u0445\u0430\u043d)\">\u041c\u0430\u0445\u043c\u0443\u0434\u0430<\/a> \u0438 \u042f\u043a\u0443\u0431\u0430, \u0441\u044b\u043d\u043e\u0432\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%85%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041a\u0430\u0437\u0430\u043d\u0441\u043a\u043e\u0435 \u0445\u0430\u043d\u0441\u0442\u0432\u043e\">\u043a\u0430\u0437\u0430\u043d\u0441\u043a\u043e\u0433\u043e<\/a> \u0445\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BB%D1%83-%D0%9C%D1%83%D1%85%D0%B0%D0%BC%D0%BC%D0%B5%D0%B4\" title=\"\u0423\u043b\u0443-\u041c\u0443\u0445\u0430\u043c\u043c\u0435\u0434\">\u0423\u043b\u0443-\u041c\u0443\u0445\u0430\u043c\u043c\u0435\u0434\u0430<\/a>, \u043d\u0430\u0433\u043e\u043b\u043e\u0432\u0443 \u0440\u0430\u0437\u0431\u0438\u043b\u043e \u0440\u0430\u0442\u044c \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0437\u044f \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_II_%D0%A2%D1%91%D0%BC%D0%BD%D1%8B%D0%B9\" title=\"\u0412\u0430\u0441\u0438\u043b\u0438\u0439 II \u0422\u0451\u043c\u043d\u044b\u0439\">\u0412\u0430\u0441\u0438\u043b\u0438\u044f II \u0422\u0451\u043c\u043d\u043e\u0433\u043e<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0431\u044b\u043b \u043f\u043b\u0435\u043d\u0451\u043d, \u0430 \u0432\u0435\u043b\u0438\u043a\u043e\u0435 \u043a\u043d\u044f\u0436\u0435\u043d\u0438\u0435, \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u0434\u0440\u0435\u0432\u043d\u0438\u043c \u043f\u043e\u0440\u044f\u0434\u043a\u043e\u043c \u043d\u0430\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f, \u043f\u0435\u0440\u0435\u0448\u043b\u043e \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BC%D0%B8%D1%8