043a\u043a\u0438\u043e<\/a>\u00bb (\u0420\u0438\u043c, \u00ab\u0416\u0443\u0440\u043d\u0430\u043b \u0434\u043b\u044f \u0434\u0435\u0442\u0435\u0439\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1891_%D0%B3%D0%BE%D0%B4\" title=\"1891 \u0433\u043e\u0434\">1891<\/a>&#160;\u2014 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD_%D0%AD%D0%BA%D1%81%D0%BF%D1%80%D0%B5%D1%81%D1%81\" class=\"mw-redirect\" title=\"\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d \u042d\u043a\u0441\u043f\u0440\u0435\u0441\u0441\">\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d \u042d\u043a\u0441\u043f\u0440\u0435\u0441\u0441<\/a>\u00bb \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D1%8B%D0%B5_%D1%87%D0%B5%D0%BA%D0%B8\" class=\"mw-redirect\" title=\"\u0414\u043e\u0440\u043e\u0436\u043d\u044b\u0435 \u0447\u0435\u043a\u0438\">\u0434\u043e\u0440\u043e\u0436\u043d\u044b\u0435 \u0447\u0435\u043a\u0438<\/a>, \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u0432\u0448\u0438\u0435 \u043f\u0440\u043e\u043e\u0431\u0440\u0430\u0437\u043e\u043c \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D0%B4%D0%B8%D1%82%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D1%80%D1%82%D0%B0\" title=\"\u041a\u0440\u0435\u0434\u0438\u0442\u043d\u0430\u044f \u043a\u0430\u0440\u0442\u0430\">\u043a\u0440\u0435\u0434\u0438\u0442\u043d\u044b\u0445 \u043a\u0430\u0440\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410\">\u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \