43d\u043e\u043c\u0438\u0438<\/a> \u0432\u0432\u0435\u0434\u0435\u043d\u0430 \u0432 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0430\u044f \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f, \u043f\u0440\u0435\u0434\u0443\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u044e\u0449\u0430\u044f \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0438\u0437 \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0440\u0435\u0444\u043e\u0440\u043c, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043d\u0430\u0441\u0442\u0430\u0438\u0432\u0430\u0435\u0442 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%88,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6_%D0%A3%D0%BE%D0%BA%D0%B5%D1%80\" title=\"\u0411\u0443\u0448, \u0414\u0436\u043e\u0440\u0434\u0436 \u0423\u043e\u043a\u0435\u0440\">\u0414\u0436\u043e\u0440\u0434\u0436 \u0411\u0443\u0448<\/a> \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0443\u0441\u043b\u043e\u0432\u0438\u044f \u0434\u043b\u044f \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044f \u043f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a>&#160;\u2014 7-13 \u0438\u044e\u043b\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D1%81%D0%B5%D0%BB%D0%BE%D0%BD%D0%B0\" title=\"\u0411\u0430\u0440\u0441\u0435\u043b\u043e\u043d\u0430\">\u0411\u0430\u0440\u0441\u0435\u043b\u043e\u043d\u0435<\/a> \u0431\u044b\u043b \u0441\u043e\u0437\u0432\u0430\u043d \u0427\u0435\u0442\u0432\u0451\u0440\u0442\u044b\u0439 \u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 \u0440\u0435\u043b\u0438\u0433\u0438\u0439 \u043c\u0438\u0440\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0441\u043e\u0431\u0440\u0430\u043b \u0431\u043e\u043b\u0435\u0435 8 \u0442\u044b\u0441\u044f\u0447 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u043e\u0432, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u0441\u043e\u0442\u0435\u043d \u0440\u0435\u043b\u0438\u0433\u0438\u043e\u0437\u043d\u044b\u0445 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0439 \u0438 \u0442\u0435\u0447\u0435\u043d\u0438\u0439 \u0438\u0437 \u0431\u043e\u043b\u0435\u0435 \u0447\u0435\u043c 60 \u0441\u0442\u0440\u0430\u043d \u043c\u0438\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2005_%D0%B3%D0%BE%D0%B4\" title=\"2005 \u0433\u043e\u0434\">2005<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B7%D1%80%D1%8B%D0%B2%D1%8B_%D0%B2_%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD%D0%B5_(2005)\" title=\"\u0412\u0437\u0440\u044b\u0432\u044b \u0432 \u041b\u043e\u043d\u0434\u043e\u043d\u0435 (2005)\">\u0441\u0435\u0440\u0438\u044f \u0442\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0430\u043a\u0442\u043e\u0432<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u043b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u043e\u043c \u043c\u0435\u0442\u0440\u043e<\/a> \u0438 \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%82%D0%BE%D0%B1%D1%83%D1%81\" title=\"\u0410\u0432\u0442\u043e\u0431\u0443\u0441\">\u0430\u0432\u0442\u043e\u0431\u0443\u0441\u0430\u0445<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2007_%D0%B3%D0%BE%D0%B4\" title=\"2007 \u0433\u043e\u0434\">2007<\/a>&#160;\u2014 \u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D1%8B%D0%B5_%D1%81%D0%B5%D0%BC%D1%8C_%D1%87%D1%83%D0%B4%D0%B5%D1%81_%D1%81%D0%B2%D0%B5%D1%82%D0%B0\" title=\"\u041d\u043e\u0432\u044b\u0435 \u0441\u0435\u043c\u044c \u0447\u0443\u0434\u0435\u0441 \u0441\u0432\u0435\u0442\u0430\">\u043d\u043e\u0432\u044b\u0445 \u0447\u0443\u0434\u0435\u0441 \u0441\u0432\u0435\u0442\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%81%D1%81%D0%B0%D0%B1%D0%BE%D0%BD\" title=\"\u041b\u0438\u0441\u0441\u0430\u0431\u043e\u043d\">\u041b\u0438\u0441\u0441\u0430\u0431\u043e\u043d\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f\">\u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u044f<\/a>. \u041f\u0440\u0430\u0437\u0434\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u0434\u043b\u044f \u0442\u0440\u0451\u0445 \u0441\u0435\u043c\u0451\u0440\u043e\u043a.<\/li><\/ul><h2>"}